@RequiresApi(Build.VERSION_CODES.O)
@Composable
fun DecomposeBase64(base64String: String) {
    val context = LocalContext.current

    val imageBytes: ByteArray = Base64.getDecoder().decode(base64String)

    val format = getImageFormat(imageBytes)

//    if (format != null) {
//        val bitmap = decompressImage(imageBytes, format)
//        Image(bitmap = bitmap, contentDescription = null)
//    }

    if (format != null) {
        val bitmap = decompressImage(imageBytes, format)
        Image(
            bitmap = bitmap,
            contentDescription = null,
            modifier = androidx.compose.ui.Modifier.fillMaxSize(), // Adjust size to fill available space
            contentScale = androidx.compose.ui.layout.ContentScale.Fit // Adjust scaling behavior
        )
    }
}

private fun getImageFormat(imageBytes: ByteArray): String? {
    val pngSignature = byteArrayOf(0x89.toByte(), 0x50, 0x4E, 0x47, 0x0D, 0x0A, 0x1A, 0x0A)
    val jpegSignature = byteArrayOf(0xFF.toByte(), 0xD8.toByte())
    val webpSignature = byteArrayOf(0x52, 0x49, 0x46, 0x46)

    return when {
        imageBytes.copyOf(8).contentEquals(pngSignature) -> "png"
        imageBytes.copyOf(2).contentEquals(jpegSignature) -> "jpeg"
        imageBytes.copyOf(3).contentEquals(
            byteArrayOf(
                0xFF.toByte(),
                0xD8.toByte(),
                0xFF.toByte()
            )
        ) -> "jpg" // "jpg" signature
        imageBytes.copyOf(4).contentEquals(webpSignature) -> "webp"
        else -> null
    }
}

private fun decompressImage(imageBytes: ByteArray, format: String): ImageBitmap {
    val inputStream = ByteArrayInputStream(imageBytes)
    val bitmap = when (format) {
        "jpeg", "jpg", "png", "webp" -> BitmapFactory.decodeStream(inputStream)
        else -> throw IllegalArgumentException("Unsupported image format: $format")
    }
    return bitmap.asImageBitmap()
}